import { useEffect } from "react";

import Footer from "../../components/footer/footer";
import "./style.css";
import { Navbartest } from "../../components/navbartest/navbartest";
// import './scripts.js';
import { Button, CssBaseline, Grid } from "@material-ui/core";
import logo from "../../assets/img/COD_LOGOvs2.png";
import AOS from "aos";
import "aos/dist/aos.css";

// import React, { CSSProperties } from "react";

function Home_test(): JSX.Element {
  useEffect(() => {
    AOS.init({ duration: 3000 });
    AOS.refresh();
  }, []);
  return (
    <>
      {/* <!-- ======= Header ======= --> */}
      {/* <Header /> */}
      <CssBaseline />
      <Navbartest />
      <Grid container spacing={2}>
        <Grid item xs={12} sm={6}>
          <Grid container spacing={3}>
            <Grid item xs={12} alignContent="center">
              <h1>Campus On Demand</h1>
              <h2>alguma descrição legal aqui.</h2>
            </Grid>
            <Grid item xs={12} alignContent="center">
              teste
            </Grid>
            <Grid item xs={12} alignContent="center">
              <div>
                {" "}
                <Button>COMECE AGORA!</Button>
              </div>
            </Grid>
          </Grid>
        </Grid>
        <Grid item xs={6} sm={6}>
          <img src={logo} className="animated" alt=""></img>
        </Grid>
      </Grid>
      <Footer />
    </>
  );
}

export default Home_test;
